class House extends React.Component {
    render() {
        const mystyle = {
            color: "#fafafa",
            backgroundColor: "#0D1B2A",
            padding: "5rem"
        };
        return (
            <div>
                <h1 style={mystyle}>House</h1>
            </div>
        );
    }
}
